import React from "react";
import styled from "styled-components";

const WarmingUpPage = () => {
  return (
  <Wrap>
    <Btn>나의 키링 보관함</Btn>
    <Btn>빼빼로 만들고 키링 뽑기</Btn>
  </Wrap>
  )
};

const Wrap = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
`;

const Btn = styled.div`
  width: 350px;
  height: 350px;
  border-radius: 50%;
  display: flex;
  align-items: center;
`;

export default WarmingUpPage;
